import React from 'react'
import foodImages from './FoodImages'
import './images.css'

export default function MainPage() {
  return (
    <div style={{ margin: "50px" }} className='shadow-lg p-3 mb-4 bg-white rounded'>
      {foodImages.map((foodImage, index) => (
        <div key={index} className='image-container'>
          <img src={foodImage.image} alt={foodImage.type} className='food-image' />
          <p className='image-type'>{foodImage.type}</p>
        </div>
      ))}
    </div>
  )
}
